import "../stylesheets/admin_layout.scss";
import "@fortawesome/fontawesome-free/css/all"
require("@rails/ujs").start()

import $ from 'jquery';
global.$ = jQuery;
import jQuery from 'jquery';
global.jQuery = jQuery;
import 'select2'
import 'select2/dist/css/select2.css'

import "./admin_layout/custom.js";

import test2 from './admin_layout/custom.js'
global.test2 = test2;



$(document).ready(function(){
  function test2(){
    alert('aaa')
  }

  window.myFunction = function test3(){ 
    alert('alert from test 3');
  }
})
